import './mapStyles.css'
import React from 'react';
import bus from "../images/smBus.png"
import map from "../images/roadMapGreen.png"
import {Link} from "react-router-dom"

const busMap = () => {
    return (
        <div className='App'>
            
                <img src={map} />
                <div class="col-8">
                <Link onClick={this.getEachBusData} id={value.bus_id} to="/Dashboard" state = {value.bus_id}>
                    <img src={bus} className="bus_way1"/>
                    <img src={bus} className="bus_way2"/>
                    <img src={bus} className="bus_way3"/>
                    <img src={bus} className="bus_way4"/>
                    <img src={bus} className="bus_way5"/>
                </Link>
                </div>
        </div>
      );
  };

  export default busMap
